import React from 'react'

function TableRow({ userContact, activeUserId }) {
    const getData = () => {
        if (userContact.userId === activeUserId) {
            for (const contactItem in userContact) {
                if (contactItem !== 'userId' && contactItem !== 'contactId') {
                    return <td>{userContact[contactItem]}</td>
                }
            }
        }
    }

    return <tr>{getData()}</tr>
}

export default TableRow
